import React, { useEffect } from 'react';
import { FaBriefcase, FaGraduationCap, FaHome, FaUser } from 'react-icons/fa';
import './Style.css';

function NavigationItems() {

    const getClickeditem = (item) => {
        console.log(item);
    }

    // useEffect(() => {
    //     var list = document.getElementById("nav_items");
    //     var items = list.getElementsByTagName("li");
        
    //     for (var i = 0; i < items.length; i++) {
    //         console.log(items[i].id);
    //     }
    // })

    return (
        <ul className="navigation" id="nav_items">
            <li id="home" onClick={console.log(this)}><FaHome size={32} color={"#2c4269"}/></li>
            <li id="aboutme"><FaUser size={32} color={"#2c4269"}/></li>
            <li id="education"><FaGraduationCap size={32} color={"#2c4269"}/></li>
            <li id="work"><FaBriefcase size={32} color={"#2c4269"}/></li>
        </ul>   
    );
}

export default NavigationItems;
